import React, { useEffect, useState, useContext } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";
import { AuthContext } from "../helpers/AuthContext";

function Profile() {
  let { id } = useParams();
  const [username, setUsername] = useState("");
  const [mobileNumber, setMobileNumber] = useState("");
  const [dob, setDob] = useState("");
  const [countryFrom, setCountryFrom] = useState("");
  const [currentCountry, setCurrentCountry] = useState("");
  const [motherTongue, setMotherTongue] = useState("");
  const [profession, setProfession] = useState("");

  const { authState } = useContext(AuthContext);

  useEffect(() => {
    axios
      .get(`http://localhost:3001/profile/${id}`, {
        headers: { accessToken: localStorage.getItem("accessToken") },
      })
      .then((response) => {
        setUsername(response.data.user.username);
        setUsername(response.data.user.username);
        setMobileNumber(response.data.user.mobile);
        setDob(response.data.user.dob);
        setCountryFrom(response.data.user.countryfrom);
        setCurrentCountry(response.data.user.currentcountry);
        setMotherTongue(response.data.user.mothertongue);
        setProfession(response.data.user.profession);
        console.log(response.data);
      });
  }, []);

  return (
    <div>
      <h1>Profile</h1>
      <div>
        <p>{username}</p>
        <h1>{mobileNumber}</h1>
        <h1>{dob}</h1>
        <h1>{countryFrom}</h1>
        <h1>{currentCountry}</h1>
        <h1>{motherTongue}</h1>
        <h1>{profession}</h1>
      </div>
    </div>
  );
}

export default Profile;
